@FoxNews Everywhere in the Western world, the hatred towards the nations gets strong.
But without nations, no Western civilisation ! We will end as the roman empire ended, wiped by history.
In the meantime, China waits for its turn to come again...

@JennaEllisEsq Donald Trump's VP is going to be DeSantis for 2024.

Then DeSantis for 2028 and 2032.

12 years of sanity: reduction of massive government spending, millions of new jobs taken back from China, individual freedom, free speech, low crime, secure border... Etc. Etc.
